import Cookies from "js-cookie";
export default function LoginSuccess(props: { nickName: string, setNickName:(arg:string) => void }) {

  const exitClickHandler = () => {
    Cookies.remove('userIdState');
    Cookies.set('loginState', JSON.stringify(''), {expires:7})
    props.setNickName('')
  }

  return (
    <>
      <div className="mb-10 mt-10 w-full h-full">
        <div className="bg-avatar w-[150px] h-[150px] bg-cover bg-no-repeat rounded-3xl ml-5"></div>
        <h3>{props.nickName}</h3>
        <button onClick={exitClickHandler} className="bg-inherit w-[50px] h-[25px] text-red-500 ml-36">
          Выйти
        </button>
      </div>
    </>
  );
}
